if mibBuilder.loadTexts: sigChanNisChanMaintenanceHandling.setDescription('This attribute specifies how channel maintenance events should be handled upon startup. Channel maintenance events include locking and unlocking a channel or channel registration. The decision is either to send individual channel RESTART messages, SERVICE messages, or nothing. Note that channel registration only occurs after the global interface restart at startup. Setting this attribute to enable SERVICE messages ensures that SERVICE messages occur at startup and whenever a channel goes into or out of service. If this attribute is not set to enable SERVICE messaging, a RESTART is always sent on unlocking a channel. globalOnStartup provides the minimum required functionality at startup, without any individual channel confirmation. Note that when this is set, channel RESTART is still used for channel unlock. globalOnStartup applies to SigChan startup only. serviceMessage enables sending and receiving SERVICE messages. If this attribute is set to serviceMessage, SERVICE messages are used for channel maintenance on channel lock, channel unlock, and startup. restartMessage specifies that individual channel RESTARTs when the SigChan starts up. If this attribute is set to restartMessage, a RESTART message is used to send at startup and channel unlock.')
